from tkinter import *
from tkinter.ttk import Progressbar
import random
import threading
import pafy
from tkinter import filedialog
import base64
import os


downloader_root = Tk()
downloader_root.resizable(0, 0)
downloader_root.maxsize(530, 400)
downloader_root.minsize(530, 400)
downloader_root.title("Youtube Downloader By Payal")
downloader_root.geometry('530x400+350+100')
downloader_root.configure(bg='#1E1B30')
icon = \
    """

"""
icondata = base64.b64decode(icon)
# The temp file is icon.ico
tempFile = "youtube.ico"
iconfile = open(tempFile, "wb")
# Extract the icon
iconfile.write(icondata)
iconfile.close()
downloader_root.wm_iconbitmap(tempFile)
# Delete the tempfile
os.remove(tempFile)
downloadindex = 0
streams = ""
totalsize = 0

# functions for logic

# close the window


def close():
    downloader_root.destroy()

# clear everything


def clear():
    urlInsert.delete(0, 'end')
    listbox.delete(0, 'end')
    progressbarLabel['text'] = ''
    DownloadingBarTextLable['text'] = 'Downloading bar'
    DownloadnigProgressBar.stop()


def changeColor():
    changeColor = random.choice(['black'])
    label1.configure(fg=changeColor)


def getvideo():
    global streams
    listbox.delete(0, END)
    url = urltext.get()
    data = pafy.new(url)
    streams = data.allstreams
    index = 0
    for i in streams:
        size = '{:0.1f}'.format(i.get_filesize()//(1024*1024))
        datas = str(index)+'.'.ljust(3, ' ') + str(i.quality).ljust(10, ' ') + \
            str(i.extension).ljust(5, ' ') + \
            str(i.mediatype) + ' '+size.rjust(10, ' ')+"MB"
        listbox.insert(END, datas)
        index += 1


def SelectorCursor(envt):
    global downloadindex
    listboxdata = listbox.get(listbox.curselection())
    downloadStream = listboxdata[:3]
    downloadindex = int(''.join(x for x in downloadStream if x.isdigit()))

# fetch all URLs


def videoURL():
    # DownloadingBarTextLable.configure(text="Fetching")
    progressbarLabel.configure(text='')
    getdetails = threading.Thread(target=getvideo)
    getdetails.start()
    DownloadingBarTextLable.configure(text="Fetched")


def downloadVideo():
    getdata = threading.Thread(target=downloadVideoData)
    getdata.start()


def downloadVideoData():
    global downloadindex
    save = filedialog.askdirectory()
    DownloadingBarTextLable.configure(text="Downloading.....")

    def mycallback(total, recieved, ratio, rate, eta):
        global totalsize
        totalsize = float('{:.5}'.format(total/(1024*1024)))
        DownloadnigProgressBar .configure(maximum=totalsize)
        DownloadnigProgressBar['value'] = recieved/(1024*1024)
    streams[downloadindex].download(
        filepath=save, quiet=True, callback=mycallback)
    DownloadingBarTextLable.configure(text="Downloaded")

# Placeholder fuction


def click(*args):
    urlInsert.delete(0, 'end')


def leave(*args):
    urlInsert.delete(0, "end")
    urlInsert.insert(0, "Paste the URL here")
    downloader_root.focus()


# scrollbar
scrollbar = Scrollbar(downloader_root)
scrollbar.place(x=385, y=127, height=194, width=20)

# URLInsert
urltext = StringVar()
urlInsert = Entry(downloader_root, textvariable=urltext,
                  font=('Raleway', 15, 'italic'), bg='#CDEAEE', width=34)
urlInsert.insert(0, 'Paste the URL here')
urlInsert.place(x=22, y=75)
urlInsert.bind("<Button-1>", click)
#urlInsert.bind("<Leave>", leave)


# Labels
label1 = Label(downloader_root, text='Welcome to Youtube Downloader',
               font=("Raleway", 22, "italic bold"), bg='#C5E6EB', fg='#EAEAEB')
label1.place(x=22, y=20)
changeColor()

listbox = Listbox(downloader_root, width=40, height=10,
                  font=('arial', 12, 'italic bold'), bg='#CDEAEE', yscrollcommand=scrollbar.set)
listbox.place(x=22, y=127)
listbox.bind("<<ListboxSelect>>", SelectorCursor)
scrollbar.configure(command=listbox.yview)

DownloadingBarTextLable = Label(
    downloader_root, text='Downloading bar', width=14, height=2, font=('Arial', 7, 'italic bold'))
DownloadingBarTextLable.place(x=422, y=350)

progressbarLabel = Label(downloader_root, text='',
                         width=62, font=('chiller', 10, 'italic bold'), bg='#CDEAEE')
progressbarLabel.place(x=22, y=350)
# progressBar

DownloadnigProgressBar = Progressbar(
    progressbarLabel, orient=HORIZONTAL, value=0, length=61, maximum=totalsize)
DownloadnigProgressBar.grid(row=0, column=0, ipadx=160, ipady=2)

# Buttons
fetchUrl = Button(downloader_root, text='Click', width='10', font=(
    'Arial', 10, 'italic bold'), fg='black', command=videoURL)
fetchUrl.place(x=420, y=75)

downloadButton = Button(downloader_root, text='Download', width='10', font=(
    'Arial', 10, 'italic bold'), command=downloadVideo)
downloadButton.place(x=420, y=130)

clearButton = Button(downloader_root, text='Clear', width='10', font=(
    'Arial', 10, 'italic bold'), command=clear)
clearButton.place(x=420, y=190)

closeButton = Button(downloader_root, text='Close', width='10', font=(
    'Arial', 10, 'italic bold'), command=close)
closeButton.place(x=420, y=260)
# main loop
downloader_root.mainloop()
